// All ISO 3166-1 alpha-2 country codes
const COUNTRY_CODES = ["AF","AX","AL","DZ","AS","AD","AO","AI","AQ","AG","AR","AM","AW","AU","AT","AZ","BS","BH","BD","BB","BY","BE","BZ","BJ","BM","BT","BO","BQ","BA","BW","BV","BR","IO","BN","BG","BF","BI","KH","CM","CA","CV","KY","CF","TD","CL","CN","CX","CC","CO","KM","CG","CD","CK","CR","CI","HR","CU","CW","CY","CZ","DK","DJ","DM","DO","EC","EG","SV","GQ","ER","EE","ET","FK","FO","FJ","FI","FR","GF","PF","TF","GA","GM","GE","DE","GH","GI","GR","GL","GD","GP","GU","GT","GG","GN","GW","GY","HT","HM","VA","HN","HK","HU","IS","IN","ID","IR","IQ","IE","IM","IL","IT","JM","JP","JE","JO","KZ","KE","KI","KP","KR","XK","KW","KG","LA","LV","LB","LS","LR","LY","LI","LT","LU","MO","MK","MG","MW","MY","MV","ML","MT","MH","MQ","MR","MU","YT","MX","FM","MD","MC","MN","ME","MS","MA","MZ","MM","NA","NR","NP","NL","NC","NZ","NI","NE","NG","NU","NF","MP","NO","OM","PK","PW","PS","PA","PG","PY","PE","PH","PN","PL","PT","PR","QA","RE","RO","RU","RW","BL","SH","KN","LC","MF","PM","VC","WS","SM","ST","SA","SN","RS","SC","SL","SG","SX","SK","SI","SB","SO","ZA","GS","SS","ES","LK","SD","SR","SZ","SE","CH","SY","TW","TJ","TZ","TH","TL","TG","TK","TO","TT","TN","TR","TM","TC","TV","UG","UA","AE","GB","US","UM","UY","UZ","VU","VE","VN","VG","VI","WF","EH","YE","ZM","ZW"];

// Cache for Intl.DisplayNames instance
let displayNamesCache = null;
let cachedLocale = null;

/**
 * Get or create Intl.DisplayNames instance for the given locale
 */
function getDisplayNames(locale) {
    const effectiveLocale = locale || getLocale();

    if (displayNamesCache && cachedLocale === effectiveLocale) {
        return displayNamesCache;
    }

    try {
        displayNamesCache = new Intl.DisplayNames([effectiveLocale], { type: 'region' });
        cachedLocale = effectiveLocale;
    } catch (e) {
        // Fallback to English
        try {
            displayNamesCache = new Intl.DisplayNames(['en'], { type: 'region' });
            cachedLocale = 'en';
        } catch (e2) {
            displayNamesCache = null;
        }
    }

    return displayNamesCache;
}

/**
 * Get the user's locale from the document or navigator
 */
function getLocale() {
    // Check for locale set by Joomla component
    if (typeof document !== 'undefined') {
        const el = document.querySelector('[data-nxp-locale]');
        if (el && el.dataset.nxpLocale) {
            return el.dataset.nxpLocale.replace('_', '-');
        }
    }

    // Fall back to browser locale
    if (typeof navigator !== 'undefined') {
        return navigator.language || 'en';
    }

    return 'en';
}

/**
 * Get localized country name using Intl.DisplayNames
 */
function getLocalizedCountryName(code, locale) {
    const displayNames = getDisplayNames(locale);
    if (displayNames) {
        try {
            const name = displayNames.of(code);
            if (name && name !== code) {
                return name;
            }
        } catch (e) {
            // Fall through
        }
    }
    return code;
}

/**
 * Get all countries as [{ code, name }] sorted by localized name
 * @param {string} [locale] - Optional locale override
 */
export function getCountries(locale) {
    const effectiveLocale = locale || getLocale();

    return COUNTRY_CODES
        .map(code => ({
            code,
            name: getLocalizedCountryName(code, effectiveLocale)
        }))
        .sort((a, b) => a.name.localeCompare(b.name, effectiveLocale));
}

/**
 * Get regions for a country code as [{ code, name }] sorted by name
 * Returns empty array if country has no regions
 * @param {string} countryCode - ISO 3166-1 alpha-2 country code
 * @param {string} [locale] - Optional locale for sorting
 */
export function getRegions(countryCode, locale) {
    const effectiveLocale = locale || getLocale();
    const upperCode = (countryCode || '').toUpperCase();
    const regionData = REGIONS[upperCode];

    if (!regionData || !Array.isArray(regionData) || regionData.length === 0) {
        return [];
    }

    return regionData
        .map(r => ({
            code: r.c,
            name: r.n
        }))
        .sort((a, b) => a.name.localeCompare(b.name, effectiveLocale));
}

/**
 * Check if a country has regions/subdivisions
 * @param {string} countryCode - ISO 3166-1 alpha-2 country code
 */
export function hasRegions(countryCode) {
    const regionData = REGIONS[(countryCode || '').toUpperCase()];
    return Array.isArray(regionData) && regionData.length > 0;
}

/**
 * Get localized country name by code
 * @param {string} countryCode - ISO 3166-1 alpha-2 country code
 * @param {string} [locale] - Optional locale override
 */
export function getCountryName(countryCode, locale) {
    if (!countryCode) return '';
    return getLocalizedCountryName((countryCode || '').toUpperCase(), locale);
}

/**
 * Get region name by country and region code
 * @param {string} countryCode - ISO 3166-1 alpha-2 country code
 * @param {string} regionCode - Region/subdivision code
 */
export function getRegionName(countryCode, regionCode) {
    if (!countryCode || !regionCode) return '';

    const upperCountry = (countryCode || '').toUpperCase();
    const regionData = REGIONS[upperCountry];

    if (!regionData) return regionCode;

    const region = regionData.find(r => r.c === regionCode);
    return region ? region.n : regionCode;
}

export default REGIONS;
